import React from 'react'
import './Sidebar.css'
import Logo from '../../imgs/et-logo.png'

import { SidebarData } from "../../Data/Data.js"

const Sidebar = () => {
    return (
        <div className="Sidebar">
            {/* logo */}
            <div className="logo">
                <img src={Logo} alt="IIT-B Dept of ET" />
                <span>eTutor</span>
            </div>

            {/* menu */}
            <div className="menu">
                {SidebarData.map((item))}
            </div>
        </div>
    )
}

export default Sidebar
